import React from 'react'
import NavBar from '../NavBar/NavBar'
import InfoLanding from './InfoLanding'

const Landing = () =>{
    return(
        <div className='w-screen h-screen bg-white'>
            <NavBar displayButton = {true} />
            <InfoLanding />
        </div>
    );
}

export default Landing;
